import { vulnsRand, vulnsStateText, vulnsState } from '@/utils/vulns-info.js'

export default {
  filters: {
    vulnsRand, vulnsStateText, vulnsState
  },
  data() {
    return {
      list: [],
      listLoading: true,
      pageSize: 10,
      total: 0,
      currentPage: 1,
      vulnsSelection: null
    }
  },
  created() {
    this.getAll()
  },
  methods: {
    getAll() {
      this.listLoading = true
      this.$http.get('/to-security', {
        'security.id': JSON.parse(sessionStorage.getItem('user')).id,
        state: 0,
        page: this.currentPage - 1,
        size: this.pageSize
      }).then(response => {
        this.list = response.content
        this.total = response.totalElements  //所有返回的数据总条数
        this.listLoading = false
      })
    },
    misreportHandleSucClick(row) {
      console.log('misreportHandleSucClick', row)
      this.$http.post('/to-security/updateState', {
        id: row.id,
        vulns: {
          id: row.vulns.id
        },
        state: 1
      }).then(v => {
        this.getAll()
      })
    },

    misreportHandleCalClick(row) {
      console.log('misreportHandleCalClick', row)
      this.$http.post('/to-security/updateState', {
        id: row.id,
        vulns: {
          id: row.vulns.id
        },
        state: 3
      }).then(v => {
        this.getAll()
      })
    }
  }
}
